import React from "react";
import Box from "@mui/material/Box";
export const Login = () => {
  const style = {
    position: "absolute",
    top: "50%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    width: 400,
    bgcolor: "#ffffff",
    borderRadius: "20px",
    boxShadow: 24,
    p: 4,
    outline: 0,
  };
  return (
    <Box sx={style}>
      <h1 className="text-xl font-titleFont font-bold text-sky-900">
        Sign up for DataVault
      </h1>
    </Box>
  );
};
